import React from "react";

const AdminHeader = () => {
  return (
    <div className="app-logo">
      <div className="content">
        <img src="/images/premium-logo-black@3x.png" alt="Premium Logo" />
      </div>
      <div className="icons">
        <img src="/images/fr@2x.png" alt="French Language Icon" />
        <img src="/images/picto-utilisateur-connecte.png" alt="User Icon" />
      </div>
    </div>
  );
};

export default AdminHeader;
